import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

const Home = () => {
  return (
    <>
      <Navbar />
      <div className="p-6 text-center">
        <h2 className="text-3xl">Welcome to KSM</h2>
        <p>Explore startups and innovations.</p>
      </div>
      <Footer />
    </>
  );
};

export default Home;
